content:
Cho thuê nhà 2 Mặt tiền 180 Nguyễn Oanh + Hẻm hông 8m (Thông qua Lê Đức Thọ) 

Kết cấu: 1 trệt (100m2), 1 Gác (45m2); 2WC cuối nhà; Lề đường rộng

Kinh doanh tự do, trừ nhạy cảm/ quán nhậu;
Giá thuê: 36 triệu/ tháng (chưa thuế); HĐ 3~5 năm; cọc 3; TT1 ~3; 
Nhận nhà liền / Có hỗ trợ giá time dịch bệnh
Liên hệ SĐT or Zalo (Diễm Kiều)

Nhà bán: 437/ Lê Đức Thọ, phường 9, quận Gò Vấp.
- Diện tích: 4,24m x 10,7m = 45,5m (công nhận 32m);

- Kết cấu: Nhà cấp 3, 3 lầu, 1 lửng (3PN, 2WC, phòng thờ, sân thượng). Tổng DTSD: 93m2;
- Vị trí: Hẻm thông 4m, ô tô vào tận nhà, khu nhà cao tầng, an ninh;

- Tiện ích: Gần đường Lê Văn Thọ, trường học, siêu thị. Có thể kinh doanh, buôn bán;
- Pháp lý: Sổ hồng chính chủ hoàn công đầy đủ;
- Giá: 3,85 tỷ, TL. Liên hệ: 0908. 302646 gặp chính chủ xem nhà.
